import React from 'react';
import PropType from 'prop-types'
import { Button as ButtonBase } from '@material-ui/core';

import './Button.scss';

const Button = props => {
    return <ButtonBase className={props.className} {...props}/>
}

Button.propType = {
    className: PropType.string
};

export default Button;
